def send_complaints(subject, body, count):
    for _ in range(count):
        receiver = random.choice(receivers)
        sender_email, sender_password = random.choice(list(senders.items()))
        if send_email(receiver, sender_email, sender_password, subject, body):
            print(f'{Fore.GREEN}                          Жалоба отправлена на {receiver} от {sender_email}༒︎ Yes kill Sakuta{Style.RESET_ALL}')
        else:
            print(f'{Fore.RED}                          Не удалось отправить жалобу на {receiver} от {sender_email} ༒︎ Not kill Sakuta{Style.RESET_ALL}')

